import React from 'react';
import MenuRoundedIcon from '@material-ui/icons/MenuRounded';

const App = () => {

    const menuToggle = () => {
        const toggle = document.getElementById('menu_icon_id');

        (toggle.style.width == '100%') ? (toggle.style.width = '0%') : (toggle.style.width = '100%');
    }

    return (
        <>
            <div className="home_main">
                <div className="header">
                    <div className="logo_div">
                        <a href="#"><h2>logo</h2></a>
                    </div>
                    <div className="menu_div" id='menu_icon_id'>
                        <ul>
                            <li><a href="#">Explore</a></li>
                            <li><a href="#">Upload</a></li>
                            <li><a href="#">Premium</a></li>
                            <li><a href="#">Help?</a></li>
                        </ul>
                    </div>
                    <div className='menu_icon'>
                        <MenuRoundedIcon onClick={menuToggle} />
                    </div>
                </div>
                <div className="hero_div">
                    <div className="title_div">
                        <h2>Images for your every need...</h2>
                        <p>With more than 100+ high quality images uploaded every week, clikpic provides more than 
                           10000+ images of different categories for your desktop background and websites. </p>
                    </div>
                </div>
                <div className="footer"></div>
            </div>
        </>
    );

}

export default App;
